import React, { useEffect } from "react";
import { Link } from "react-router-dom";
const AdminHeader = () => {

  useEffect(() => {
    OpenSideBar();
    if (window.matchMedia("(max-width: 1200px)").matches) {
      $("#mySidenav").css("width", "0");
      $("body").css("marginRight", "0");
    } 
  });

//   const OpenSideBar = () => {
//     const urlSearchParams = new URLSearchParams(window.location.search).get(
//       "clientId", 
//     );
   
//     if (window.matchMedia("(max-width: 1200px)").matches) {
//       $("#mySidenav").css("width", "250px");
//       $("body").css("marginRight", "250px");
//     } 
//   };

  const CloseSideBar = () => {
    $("#mySidenav").css("width", "0");
    $("body").css("marginRight", "0");
  };
  
  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-light bg-black shadow-md">
        <div className="container-fluid p-2">
          <Link
            to="/marketplace"
            className="navbar-brand text-primary mr-0 pt-0 pb-0"
          >
            <img
              alt="logo"
              src={
                "https://s3.amazonaws.com/pipelinedeals_account_logos_production/logos/1682411/thumb/FLUX_White_JPG.jpg?1586880409"
              }
              className="img-fluid"
            />
          </Link>
          <div
            className="form-inline ml-auto navbar-icons"
            style={{ marginLeft: "auto" }}
          >
            <div
              className="btn"
              style={{ color: "#fff" }}
              onClick={OpenSideBar}
            >
              <i className="fa fa-bars" title="Collapse"></i>
            </div>
          </div>
        </div>
      </nav>

      <div id="mySidenav" className="sidenav">
        <div className="sd-header">
          <h4 className="mb-0">Sidebar Header</h4>
          <div className="btn close-btn" onClick={CloseSideBar}>
            <i className="fa fa-times"></i>
          </div>
        </div>
        <div className="accordion" id="accordionExample">
         
              <Link to="/marketplace" className="nav-item">
                <i className="fa-regular fa-user"></i> Marketplace
              </Link>
              <div className="accordion-item border-0">
                <h2 className="accordion-header" id="headingOne">
                  <button
                    className="accordion-button collapsed pt-0 pb-0 ps-0"
                    type="button"
                    data-bs-toggle="collapse"
                    data-bs-target="#collapsetwo"
                    aria-expanded="true"
                    aria-controls="collapsetwo"
                  >
                    <Link to="#" className="nav-item">
                      <i className="fa-light fa-file-invoice"></i> Submissions
                    </Link>
                  </button>
                </h2>
                <div
                  id="collapsetwo"
                  className="accordion-collapse collapse"
                  aria-labelledby="headingOne"
                  data-bs-parent="#accordionExample"
                >
                  <div className="accordion-body">
                    <Link
                      to="/submissions/all/1/20"
                      className="nav-item border-0"
                    >
                      <i className="fa-light fa-ballot"></i> All Submissions
                    </Link>
                    <Link
                      to="/submissions/Open/1/20"
                      className="nav-item border-0"
                    >
                      <i className="fa-light fa-ballot"></i> Incomplete
                    </Link>
                    <Link
                      to="/submissions/all/1/20"
                      className="nav-item border-0"
                    >
                      <i className="fa-light fa-ballot"></i> Pending/Action
                      Required
                    </Link>
                   <Link
                      to="/submissions/Closed/1/20"
                      className="nav-item border-0"
                    >
                      <i className="fa-light fa-ballot"></i> Closed
                    </Link>
                    <Link
                      to="/submissions/Bound/1/20"
                      className="nav-item border-0"
                    >
                      <i className="fa-light fa-ballot"></i> Bound
                    </Link>
                    <Link
                      to="/submissions/Proposed/1/20"
                      className="nav-item border-0"
                    >
                      <i className="fa-light fa-ballot"></i> Proposed
                    </Link>
                  </div>
                </div>
              </div>

              <Link to="/clients/1/5" className="nav-item">
                <i className="fa-light fa-ballot"></i> Clients
              </Link>
              <Link to="/resources" className="nav-item">
                <i className="fa-light fa-chart-simple"></i> Resources
              </Link>
          </div>
      </div>
    </>
  );
};

export default AdminHeader;
